import React from "react";

const Header = () => {
  return (
    <header>
      <h1>Bowling League - Marlins & Sharks</h1>
      <p>
        Welcome to the Bowling League! Below is a list of bowlers who are part of the Marlins and Sharks teams.
        This table displays each bowler's name, team, address, and contact details.
      </p>
    </header>
  );
};

export default Header;
